import React from "react";
import ReactDom from "react-dom/client";
import Home from "./home";
import Contact from "./contact";
import About from "./about";
import Layout from "./layout";

import { BrowserRouter, Routes, Route } from "react-router-dom";
import AllFacultyName from "./allfaculty";
import Faculty10exp from "./faculty10exp";
import FacultyDesign from "./allfacultydesign";  // Make sure this file exists

const root = ReactDom.createRoot(document.getElementById("root"));

root.render(
  <BrowserRouter>
    <Routes>
      <Route path="/" element={<Layout />}>
        <Route path="home" element={<Home />} />
        <Route path="about" element={<About />} />
        <Route path="contact" element={<Contact />} />
        <Route path="all-faculty-name" element={<AllFacultyName />} />
        <Route path="faculty-10-exp" element={<Faculty10exp />} />
        <Route path="faculty-design" element={<FacultyDesign />} />
      </Route>
    </Routes>
  </BrowserRouter>
);
